import React from "react";
import { HashRouter as Router, Switch, Route } from "react-router-dom";
import Nav from "../Nav/Nav";
import Hom from "../Home/Home";

const App = () => {
  return (
    <Router>
      <Nav />
      <Switch>
        <Route path="/" exact component={Home} />
      </Switch>
    </Router>
  );
};

export default App;
